const needle = 'FD709';

/**
 * Return a short statement about the type of billboard for a given type.
 * @param {string} type The type of billboard. Options are Bulletin, Digital Bulletin, TriVision, etc.
 * @return {string} Definition sentence of the billboard type.
 */
const getTypeDefinition = type => {
	let typeDefinition = 'Definition for Bulletin';
	// set the variable 'typeDefinition' based on the billboard type for a given billboard.
	switch ( type ) {
	case 'Digital Bulletin':
		typeDefinition = 'Definition for Digital Bulletin';
		break;
	case 'Trivision':
		typeDefinition = 'Definition for Trivision';
		break;
	case 'Junior Bulletin':
		typeDefinition = 'Definition for Junior Bulletin';
		break;
	case 'Superscape':
		typeDefinition = 'Definition for Superscape';
		break;
	default:
		typeDefinition = 'Definition for Bulletin';
	}
	return typeDefinition;
};
