/**
 * Get Google Maps' Streetview Photo of an individual billboard.
 * @param {Array} mapData The data passed using the wp_localize_script function in the class \Google_Maps\Component.
 * @return {string} HTML image of the billboard.
 */
const getStreetView = ( coordinates, mapData ) => {
	const a = mapData.streetViewSize;
	const b = coordinates;
	const c = mapData.apiKey;
	return `
  <img
  class=""
  src="https://maps.googleapis.com/maps/api/streetview?size=${a}x${a}&location=${b.lat},${b.lng}&key=${c}"
  />
  `;
};

const billboards = []; // Instantiate the billboards array - will be filled by the allBillboards mapping function.

// Populate the billboards - from 'billboard_locations.js' array with data.
allBillboards.map( billboard => {
	// If a billboard has more than one face (as most do), create an array to store individual face information.
	const faceInformation = [];
	if ( 2 <= billboard.length ) {
		billboard.forEach( face => {
			const width                    = face.width ? face.width : 0;
			const height                   = face.height ? face.height : 0;
			const billboardFaceInformation = {
				id: face.id,
				direction: face.direction,
				category: face.category,
				dimensions: face.dimensions,
				media: face.media,
				illumination: face.illumination,
				substrate: face.substrate,
			};
			// Set pixels as an object property only shows up when there are dimensions for height and width on the face.
			if ( 0 < width + height ) {
				billboardFaceInformation.pixels =  { x: width, y: height };
			}
			// push all the information for a given face into the out
			faceInformation.push( billboardFaceInformation );
		}); // end forEach for billboard faces.
	}
	// end if ( billboard.length >= 2 )

	const properties = {
		id: billboard.id ? billboard.id.substring( 0, 5 ) : billboard[ 0 ].id.substring( 0, 5 ),
		category: billboard.category ? billboard.category : billboard[ 0 ].category,
		coordinates: {
			lat: parseFloat( billboard.latitude ? billboard.latitude : billboard[ 0 ].latitude ),
			lng: parseFloat( billboard.longitude ? billboard.longitude : billboard[ 0 ].longitude ),
		},
		faces: Array.isArray( billboard ) ? billboard.length : 1,
		description: billboard.description ? billboard.description : billboard[ 0 ].description,
		media: billboard.media ? billboard.media : billboard[ 0 ].media,
	};

	// The 'properties' object won't have a faceInformation property if there isn't more than one face attached to the billboard.
	if ( 1 < properties.faces ) {
		properties.faceInformation = faceInformation ? faceInformation : 'only a single face';
	}

	// Push each 'properties' object derived from the allBillboards array into a new array called 'billboards'
	billboards.push( properties );
	return billboards;
});
